import './App.css';
import Header from './components/Header';
import Main from './components/Main';

function App() {
  return (
    <div className="App">
     <h1>Welcome to React!</h1>
     <Header />
     <Main name="Adam" address ="NYC" style = {{blue}}/>
    </div>
  );
}

export default App;
